import { BrowserRouter as Router, Routes, Route } from "react-router-dom"; // Import Routes here
import Jion from "./component/Jion/Jion.js";
import './App.css';

function App() {
  return (
    <div className="App">
      <Router>
        <Routes> {/* Wrap Route components in Routes */}
          <Route path="/" element={<Jion />} /> {/* Use JSX syntax for component */}
          <Route path="/chat" element={<div>Chat Component</div>} /> {/* Example for /chat route */}
        </Routes>
      </Router>
    </div>
  );
}

export default App;
